    console.log(props.props)
    const lists = props.props;

    return(
    <>
        <div>
            {lists && lists.map(list => (
                <>
                    <li props={list} key={list.NTC_ID}>{list.NTC_ID}</li>
                </>
            ))}
        </div>
    </>
